import React from 'react';
import ProjectLink from "../components/project_link.js"

function Home() {
  return (
    <div className="Home">
      <section className = "projects_home">
        <ProjectLink/>
        <ProjectLink/>
        <ProjectLink/>
      </section>
      <section className = "about_home">
        <h1>CLARA GILLIGAN</h1>

      </section>
      
    </div>
  );
}

export default Home;
